import 'package:carousel_slider/carousel_slider.dart';
import 'package:flutter/material.dart';
import 'package:smooth_page_indicator/smooth_page_indicator.dart';

class HomePage extends StatefulWidget {
  const HomePage({super.key});

  @override
  State<HomePage> createState() => _HomePageState();
}

class _HomePageState extends State<HomePage> {
  final myItems = [
    Image.asset('assets/banners/banner1.jpg'),
    Image.asset('assets/banners/banner2.jpg'),
    Image.asset('assets/banners/banner3.jpg'),
  ];
  int myCurrentIndex = 0;

  @override
  Widget build(BuildContext context) {
    return Scaffold(
      appBar: AppBar(
        leading: IconButton(onPressed: () {}, icon: const Icon(Icons.menu)),
        title: Padding(
          padding: const EdgeInsets.only(left: 70),
          child: Image.asset('assets/images/logo.png', height: 30),
        ),
        actions: [
          IconButton(onPressed: () {}, icon: const Icon(Icons.search)),
          IconButton(
              onPressed: () {}, icon: const Icon(Icons.shopping_cart_outlined)),
        ],
      ),
      body: Column(
        children: [

          CarouselSlider(
            options: CarouselOptions(
              autoPlay: true,
              height: 200,
              autoPlayCurve: Curves.fastOutSlowIn,
              autoPlayAnimationDuration: const Duration(milliseconds: 800),
              autoPlayInterval: const Duration(seconds: 2),
              onPageChanged: (index, reason) {
                myCurrentIndex = index;
              },
            ),
            items: myItems,
          ),
          SizedBox(
            height: 5,
          ),
          AnimatedSmoothIndicator(
            activeIndex: myCurrentIndex,
            count: myItems.length,
            effect: WormEffect(
                dotHeight: 8,
                dotWidth: 8,
                spacing: 10,
                dotColor: Colors.grey.shade200,
                activeDotColor: Colors.grey.shade900,
                paintStyle: PaintingStyle.fill),
          ),
          SingleChildScrollView(
            scrollDirection: Axis.horizontal,
            child: Row(
              children: categoryList.map((e) => Padding(
                padding: const EdgeInsets.only(left: 8),
                child: Card(
                  color: Colors.white,
                  elevation: 13,
                  shape: RoundedRectangleBorder(
                    borderRadius: BorderRadius.circular(20),
                  ),
                  child: SizedBox(
                    height: 100,
                    width: 100,
                    child: Image.network(e),
                  ),
                ),
              ),).toList(),
            ),
          ),
          const SizedBox(height: 5,),
          ListView.builder(itemBuilder: (context, index) {
            return Column(
              children: [
                ListTile(
                  leading: Image.network('https://quichemygrits.com/wp-content/uploads/2021/10/Fresh-Fruit-Platter-9.jpeg'),
                  title: const Text('Fruits',style: TextStyle(fontWeight: FontWeight.bold)),
                  subtitle: const Text('loremipsum'),
                  trailing: Icon(Icons.navigate_next),
                ),
                ListTile(
                  leading: Image.network('https://quichemygrits.com/wp-content/uploads/2021/10/Fresh-Fruit-Platter-9.jpeg'),
                  title: const Text('Fruits',style: TextStyle(fontWeight: FontWeight.bold)),
                  subtitle: const Text('loremipsum'),
                  trailing: Icon(Icons.navigate_next),
                ),
              ],
            );
          },)
        ],
      ),
    );
  }
}

